import React, { Component } from "react";
import axios from "axios";

export default class TestNote extends Component {
  constructor(props) {
    super(props);

    this.state = {
      username: "",
      password: "",
      todoList: "",
    };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5000/")
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });
  }
}

